import React from "react";
import IssuesComponent from "../Components/IssuesPage/IssuesComponent";
import { Helmet } from 'react-helmet';

function IssuesPage() {
  const pageTitle = "Issues | IYNA October Chapter";
  const pageDescription = "Explore key topics, challenges, and recent developments shaping the field of neuroscience.";
  const pageUrl = "https://iynaoct.com/Issues";
  const ogImage = "https://iynaoct.com/og-image.jpg";
  return (
    <React.Fragment>
      <Helmet>
        {/* Standard SEO */}
        <title>{pageTitle}</title>
        <meta name="description" content={pageDescription} />
        <meta name="robots" content="index, follow" />
        <link rel="canonical" href={pageUrl} />
        
        {/* Open Graph / Facebook */}
        <meta property="og:type" content="website" />
        <meta property="og:url" content={pageUrl} />
        <meta property="og:title" content={pageTitle} />
        <meta property="og:description" content={pageDescription} />
        <meta property="og:image" content={ogImage} />
        
        {/* Twitter */}
        <meta name="twitter:card" content="summary_large_image" />
        <meta name="twitter:title" content={pageTitle} />
        <meta name="twitter:description" content={pageDescription} />
        <meta name="twitter:image" content={ogImage} />
        
        {/* Structured Data */}
        <script type="application/ld+json">
          {JSON.stringify({
            "@context": "https://schema.org",
            "@type": "EducationalOrganization",
            "name": "IYNA October Chapter - Issues",
            "url": pageUrl,
            "description": pageDescription,
            "address": {
              "@type": "PostalAddress",
              "addressLocality": "Cairo",
              "addressRegion": "EG-C",
              "addressCountry": "EG"
            },
            "geo": {
              "@type": "GeoCoordinates",
              "latitude": "30.0444",
              "longitude": "31.2357"
            }
          })}
        </script>
      </Helmet>
        <IssuesComponent />
    </React.Fragment>
  );
}

export default IssuesPage;
